  false,\n\t\"url\": null,\n\t\"notes\": \"The AgSat Areas of Interest map contains
  area polygons where satellite imagery will be collected for the Farm Service Agency
  (FSA) to provide imagery coverage for FSA business to include image base replacement,
  torando damage assessment, and drought assessment. The map shows areas of interest
  that have been awarded (green) and areas that were planned for but did not get awarded
  (tan). This imagery is collected under a satellite blanket purchase agreement created
  for FSA by the Aerial Photography Field Office in Salt Lake City. For more information
  about this program please contact the contracting officer Jacque La Croix. Click
  on the bookmark tab in the map to zoom to each area of interest on the map. Click
  on a polygon inside the map to display an informational popup.\",\n\t\"license_title\":
